import styles from "./SnapShots.module.css";

const SnapShots = () => {
  return (
    <div className={styles.container}>
      <div className={styles.header}>Nə üçün istifadə edə bilərəm</div>
      <div className={styles.snapShotsWrapper}>
        <div
          style={{ background: "url(/snapShots.svg)" }}
          className={styles.snaps}
        ></div>
        <div className={styles.text}>
          <div className={styles.text__smallHeader}>Əməkdaşlar</div>
          <div className={styles.text__desc}></div>
        </div>
      </div>
      <div className={styles.snapShotsWrapper}>
        <div className={` ${styles.oppositeText}`}></div>
        <div className={` ${styles.oppositeSnap}`}></div>
      </div>
      <div className={styles.snapShotsWrapper}>
        <div
          style={{ background: "url(/snapShots.svg)" }}
          className={styles.snaps}
        ></div>
        <div className={styles.text}></div>
      </div>
    </div>
  );
};

export default SnapShots;
